import "./style.scss";
import Filter from "./Filter/Filter";
import FilterSection from "./Filter/FilterSection";
import FilterItem from "./Filter/FilterItem";
import Add from "./Add/Add";

export default function Header() {
	return (
		<div className="main-header">
			<Add />
			<input placeholder="search" className="input-search" maxLength={35} pattern="" />
			<Filter>
				<FilterSection title="To day">
					<FilterItem>Last day</FilterItem>
					<FilterItem>this week</FilterItem>
				</FilterSection>
				<FilterSection title="Com">
					<FilterItem>To day</FilterItem>
					<FilterItem>Last day</FilterItem>
					<FilterItem>this week</FilterItem>
				</FilterSection>
			</Filter>
		</div>
	);
}
